e duren toda una vida\nNaturalmente tampoco quien las aguante\nY no me beses la mejilla como premio de consolación\nNo me cuelgues la medalla y menos si es de plata\nBien pudiéramos negociar una segunda opción\nMas no me tengas compasión\nPorque eso sí que mata\n\nPon las cartas sobre la mesa\nQuizá y el trato me interesa\nY este nudo no se desata\n\nMusic video by Alfredo Olivas performing Medalla De Plata. © 2020 Sahuaro Enterprise, Inc., Distributed by UMG Recordings Inc.\n\nhttp://vevo.ly/0QyLPD"},"lengthSeconds":"183","ownerProfileUrl":"http://www.youtube.com/@AlfredoOlivasVEVO","externalChannelId":"UC2a98faJ-hicyUR15M81pKg","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"39409340","category":"Music","publ bilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Feature Video\n   • Alfredo Olivas - Medalla De Plata  \n\nDescription Video\n\nThis is Chuy Lizárraga on Spotify: https://open.spotify.com/playlist/37i...\nSigue a Alfredo Olivas\nInstagram: https://www.instagram.com/alfredooliv...\nFacebook:   / alfredoolivasmusica  \nSpotify: https://open.spotify.com/artist/5xYNm...\nApple Music:   / alfredo-olivas  \nClaro Música: https://www.claromusica.com/artist/21...\n\nMEDALLA DE PLATA\nTan cerca de perderte, tan lejos de olvidarte\nHaciendo por tenerte, lo que esta de mi parte\nTú ya estás decidida y yo estoy desesperado\nMe apartas de tu vida y yo te quiero a mi lado\nEste jueguito ya me tiene sin salida\nEs evidente que estoy más que acorralado\nNo tiene caso ya que gaste más saliva\nMejor empezaré a ver qué demonios hago\nNo me beses la mejilla como premio de consolación\nNo me cuelgues la medalla y menos si es de plata\nBien pudiéramos negociar una segunda opción\nMás ni piedad, ni compasión, porque eso sí que mata\nPon las cartas sobre la mesa\nQuizás y el trato me interesa\nY este nudo no se desata\nY si realmente ya te encuentras decidida\nSi lo que pienso te parece irrelevante\nNo hay decepciones que duren toda una vida\nNaturalmente tampoco quien las aguante\nY no me beses la mejilla como premio de consolación\nNo me cuelgues la medalla y menos si es de plata\nBien pudiéramos negociar una segunda opción\nMas no me tengas compasión\nPorque eso sí que mata\n\nPon las cartas sobre la mesa\nQuizá y el trato me interesa\nY este nudo no se desata\n\nMusic video by Alfredo Olivas performing Medalla De Plata. © 2020 Sahuaro Enterprise, Inc., Distributed by UMG Recordings Inc.\n\nhttp://vevo.ly/0QyLPD","commandRuns":[{"startIndex":14,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CMADEM2rARgBIhMIobCnqK3QiAMV_4z_BB2R4CZc","commandMetadata":{"webCommandMe andMetadata":{"url":"/@AlfredoOlivasVEVO","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UC1bZ17RdXYpjsgDKWxaYCYA","canonicalBaseUrl":"/@AlfredoOlivasVEVO"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/yhejwvleuMdRUoqey03r81NedpwNP0YUnRfG_a57z7_CZFty-JP_XqgPRQ-dQDlU3_2PA2hJoA=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"accessibility":{"accessibilityData":{"label":"Mostrar más"}},"simpleText":"...más"},"showLessText":{"simpleText":"Mostrar menos"},"attributedDescriptionBodyText":{"content":"Feature Video\n   • Alfredo Olivas - Medalla De Plata  \n\nDescription Video\n\nThis is Chuy Lizárraga on Spotify: https://open.spotify.com/playlist/37i...\nSigue a Alfredo Olivas\nInstagram: https://www.instagram.com/alfredooliv...\nFacebook:   / alfredoolivasmusica  \nSpotify: https://open.spotify.com/artist/5xYNm...\nApple Music:   / alfredo-olivas  \nClaro Música: https://www.claromusica.com/artist/21...\n\nMEDALLA DE PLATA\nTan cerca de perderte, tan lejos de olvidarte\nHaciendo por tenerte, lo que esta de mi parte\nTú ya estás decidida y yo estoy desesperado\nMe apartas de tu vida y yo te quiero a mi lado\nEste jueguito ya me tiene sin salida\nEs evidente que estoy más que acorralado\nNo tiene caso ya que gaste más saliva\nMejor empezaré a ver qué demonios hago\nNo me beses la mejilla como premio de consolación\nNo me cuelgues la medalla y menos si es de plata\nBien pudiéramos negociar una segunda opción\nMás ni piedad, ni compasión, porque eso sí que mata\nPon las cartas sobre la mesa\nQuizás y el trato me interesa\nY este nudo no se desata\nY si realmente ya te encuentras decidida\nSi lo que pienso te parece irrelevante\nNo hay decepciones que duren toda una vida\nNaturalmente tampoco quien las aguante\nY no me beses la mejilla como premio de consolación\nNo me cuelgues la medalla y menos si es de plata\nBien pudiéramos negociar una segunda opción\nMas no me tengas compasión\nPorque eso sí que mata\n\nPon las cartas sobre la mesa\nQuizá y el trato me interesa\nY este nudo no se desata\n\nMusic video by Alfredo Olivas performing Medalla De Plata. © 2020 Sahuaro Enterprise, Inc., Distributed by UMG Recordings Inc.\n\nhttp://vevo.ly/0QyLPD","commandRuns":[{"startIndex":14,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB0Q040EGAUiEwihsKeordCIAxX_jP8EHZHgJlw=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=ndO1zdsrREw\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"ndO1zdsrREw","startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-cxnuxa-hxms.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026siu=1\u0026msp=1\u0026odepv=1\u0026id=9dd3b5cddb2b444c\u0026ip=189.215.144.213\u0026initcwndbps=778750\u0026mt=1726794775\u0026oweuc="}}}}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: Alfredo Olivas - Medalla De Plata"}}},{"startIndex":110,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB0Q040EGAUiEwihsKeordCIAxX_jP8EHZHgJlxIzIit2d257emdAQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbG9oeDMtTDBqSERMdWxST3gtZnFibnNWYm85d3xBQ3Jtc0tub2lrU1d0TU5zZjdZSklJX2lUVTB5Yy1xd0dHM0c3WU5UdEdKRXQ2Y2hBVW53bXJ0aVdOVHRGV3RHVEhwVXZNVS0xb215bkxNeHJvcUw0dlRkNTJyVnZBOFBIMGdGZ3dmODdIc25QTzJwS2lXSEpzcw\u0026q=https%3A%2F%2Fopen.spotify.com%2Fplaylist%2F37i9dQZF1DWVClsLZrdNUx%3Fsi%3DO3rdr1k1Qy2bwFVEjXeMzA\u0026v=ndO1zdsrREw","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbG9oeDMtTDBqSERMdWxST3gtZnFibnNWYm85d3xBQ3Jtc0tu
